import logo from './usd_flightsearch.jpeg'; 
import TextField from '@material-ui/core/TextField';

console.log(logo);

function App() {

  return (
    <div className="App">
      <header className="App-header">
          <h1>
            Expert Flight Search
          </h1>

          <div className="logo">
          <img src={logo} alt="logo"/>
        </div>
      </header>


      <form>

        <div>

        <input type="radio" value="oneway" name="genbookingtypeder" /> One way
        <input type="radio" value="round" name="bookingtype" /> Round Trip

        </div>

        <label>
          <input type="text" placeholder="Leaving from" name="source" /> <br/><br/>
        </label>

        <label>
          {/* Going to: */}
          <input type="text" placeholder="Going to" name="destination" /> <br /><br/>
        </label>
        {/* <TextField
          id="date"
          label="Choose your birthdate"
          type="date"
          defaultValue="2017-05-24"
          InputLabelProps={{
            shrink: true,
          }}
        /> */}

        <input type="submit" value="Search" />

    </form>


    </div>
  );
}

